<!DOCTYPE html>
<html lang="en">
<head>
    <title>Formulario</title>
    <meta charset="utf-8">
    <meta name="viewport" content="width=device-width, initial-scale=1">
    <style type="text/css">
        body {
            background-image: linear-gradient(to right, rgba(255,0,0,0), rgba(255,0,0,1));!important;
        }
    </style>
    <link rel="stylesheet" href="https://maxcdn.bootstrapcdn.com/bootstrap/4.5.2/css/bootstrap.min.css">
    <script src="https://ajax.googleapis.com/ajax/libs/jquery/3.5.1/jquery.min.js"></script>
    <script src="https://cdnjs.cloudflare.com/ajax/libs/popper.js/1.16.0/umd/popper.min.js"></script>
    <script src="https://maxcdn.bootstrapcdn.com/bootstrap/4.5.2/js/bootstrap.min.js"></script>
</head>
<body>
<div class="container">
    <div class="text-center">
        <div class="row">
            <img style="width:100px; height:100px;" src="data:image/png;base64,"></h1>
            <div class="col-sm-10 text-center">
                <h1>Formulario de registro</h1>
            </div>
        </div>

    </div>

    <div class="container">
        <div class="row">
            <div class="col-sm-12 col-md-6">
                <h5>Nombre</h5>
                <input class="col-sm-6" type="text" value="" maxlength="10">
            </div>
            <div class="col-sm-12 col-md-6">
                <h5>Apellido</h5>
                <input class="col-sm-6" type="text" value="" maxlength="10">
            </div>
            <div class="col-sm-12 col-md-6">
                <h5>Tipo de documento</h5>
                <select class="col-sm-6" name="select">
                    <option value="value1" selected>CC</option>
                    <option value="value2">TI</option>
                    <option value="value3">CE</option>
                    <option value="value3">NIT</option>
                </select>
            </div>
            <div class="col-sm-12 col-md-6">
                <h5>Numero documento</h5>
                <input class="col-sm-6" type="number" value="" maxlength="12">
            </div>
            <div class="col-sm-12 col-md-6">
                <h5>Correo electronico</h5>
                <input class="col-sm-6" type="email" value="" pattern=".+@globex\.com" size="30" required>
            </div>
            <div class="col-sm-12 col-md-6">
                <h5>Tipo de solicitud</h5>
                <select class="col-sm-6" name="select">
                    <option value="value1" selected>Tipo 1</option>
                    <option value="value2">Tipo 2</option>
                    <option value="value3">Tipo 3</option>
                    <option value="value3">Tipo 4</option>
                </select>
            </div>
            <div class="col-sm-12">
                <h5>Solicitud</h5>
                <textarea class="col-sm-12" value=""></textarea>
            </div>
            <div class="container">
                <div class="row">
                    <div class="col text-center">
                        <button class="btn btn-danger">Enviar</button>
                    </div>
                </div>
            </div>
        </div>

    </div>
</div>

</body>
</html>
